// Test upload - minimal code
module.exports.loop = function () {
    console.log('Tick ' + Game.time + ' - Claude AI is running!');

    // Emergency: If we have no spawn, log critical error
    const spawns = Object.values(Game.spawns);
    if (spawns.length === 0) {
        console.log('CRITICAL: No spawns available!');
        console.log('Available rooms:', Object.keys(Game.rooms));
        console.log('Need to place spawn via HTTP API');
        return;
    }

    console.log('We have spawn:', spawns[0].name, 'at', spawns[0].pos);
};
